import React from 'react'
import * as FaIcons from "react-icons/fa";
import * as AiIcons from "react-icons/ai";

export const SidebarData = [
{
    title: "Home",
    path: "/",
    icon: <AiIcons.AiFillHome />,
    cName: "nav-text"
},
{
    title: "Profile",
    path: "/profile",
    icon: <AiIcons.AiFillProfile />,
    cName: "nav-text"
},
{
    title: "Playlist",
    path: "/playlist",
    icon: <AiIcons.AiFillFolderAdd />,
    cName: "nav-text"
}

]
